import 'dart:convert';
import 'dart:io';

import 'package:flutter/material.dart';
import 'package:open_filex/open_filex.dart';
import 'package:path_provider/path_provider.dart';

class Pdd extends StatefulWidget {
  final dynamic title;

  const Pdd({super.key, required this.title});

  @override
  State<Pdd> createState() => _PddState();
}

class _PddState extends State<Pdd> {
  bool _isLoading = false;
  String _errorMessage = '';

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: Text(widget.title), centerTitle: true),
      body: Center(
        child: Column(
          mainAxisAlignment: MainAxisAlignment.center,
          children: [
            ElevatedButton(
              style: ElevatedButton.styleFrom(
                padding: const EdgeInsets.symmetric(
                  horizontal: 24,
                  vertical: 12,
                ),
              ),
              onPressed: _isLoading ? null : _handlePdfGeneration,
              child:
                  _isLoading
                      ? const CircularProgressIndicator()
                      : const Text(
                        'Generate PDF',
                        style: TextStyle(fontSize: 18),
                      ),
            ),
            const SizedBox(height: 20),
            if (_errorMessage.isNotEmpty)
              Padding(
                padding: const EdgeInsets.all(16.0),
                child: Text(
                  _errorMessage,
                  style: const TextStyle(color: Colors.red),
                  textAlign: TextAlign.center,
                ),
              ),
          ],
        ),
      ),
    );
  }

  Future<void> _handlePdfGeneration() async {
    setState(() {
      _isLoading = true;
      _errorMessage = '';
    });

    try {
      // This is just a sample base64 PDF string (truncated for example)
      // In a real app, you would get this from an API or another source
      var base64String =
          '';
      // Note: The base64 string above is intentionally truncated and will not generate a valid PDF

      await _base64ToPdf(base64String, 'sample_document');

      ScaffoldMessenger.of(context).showSnackBar(
        const SnackBar(
          content: Text('PDF generated and opened successfully'),
          backgroundColor: Colors.green,
        ),
      );
    } catch (e) {
      setState(() {
        _errorMessage = 'Error generating PDF: ${e.toString()}';
      });
      ScaffoldMessenger.of(context).showSnackBar(
        SnackBar(
          content: Text('Failed to generate PDF: ${e.toString()}'),
          backgroundColor: Colors.red,
        ),
      );
    } finally {
      setState(() {
        _isLoading = false;
      });
    }
  }

  Future<void> _base64ToPdf(String base64String, String fileName) async {
    try {
      // Add padding if needed
      final paddedBase64 = base64String.trim().padRight(
        (base64String.length + 3) & ~3,
        '=',
      );

      final bytes = base64Decode(paddedBase64);

      final output = await getTemporaryDirectory();
      final filePath = "${output.path}/$fileName.pdf";
      final file = File(filePath);

      await file.writeAsBytes(bytes);

      final result = await OpenFilex.open(filePath);

      if (result.type != ResultType.done) {
        throw Exception("Could not open the PDF file: ${result.message}");
      }
    } catch (e) {
      throw Exception("PDF conversion failed: ${e.toString()}");
    }
  }
}

